var pageDataLayerObject = JSON.parse("{\x22properties\x22:{\x22@type\x22:\x22kkr\u002Daem\u002Dbase\/components\/structure\/page\/basepage\x22,\x22repo:modifyDate\x22:\x222023\u002D09\u002D26T12:28:46Z\x22,\x22dc:title\x22:\x22404 Error\x22,\x22xdm:template\x22:\x22\/conf\/kkr\/settings\/wcm\/templates\/freeform\x22,\x22xdm:language\x22:\x22en\x22,\x22country\x22:\x22global\x22,\x22siteName\x22:\x22kkr\x22,\x22xdm:tags\x22:[],\x22repo:path\x22:\x22\/content\/kkr\/sites\/global\/en\/errors\/404\x22,\x22canonicalUrl\x22:\x22https:\/\/www.kkr.com\/errors\/404\x22,\x22pageName\x22:\x22404\x22,\x22pageType\x22:\x22freeform\x22,\x22environment\x22:\x22prod\x22,\x22siteSection\x22:\x22errors\x22,\x22siteSubsection1\x22:\x22404\x22,\x22siteSubsection2\x22:\x22\x22,\x22siteSubsection3\x22:\x22\x22,\x22siteSubsection4\x22:\x22\x22,\x22sitePageName\x22:\x22errors|404\x22,\x22topic\x22:\x22\x22}}");
if (pageDataLayerObject !== null) {
    (function () {
        function getLocalTimestamp() {
            var now = new Date();
            var year = now.getFullYear();
            var month = ("0" + (now.getMonth() + 1)).slice(-2);
            var day = ("0" + now.getDate()).slice(-2);
            var hour = ("0" + now.getHours()).slice(-2);
            var min = ("0" + now.getMinutes()).slice(-2);
            var sec = ("0" + now.getSeconds()).slice(-2);
            return year + "-" + month + "-" + day + "T" + hour + ":" + min + ":" + sec;
        }

        function pushKkrDataLayerProperties() {
            window.kkrDataLayer = window.kkrDataLayer || [];
            kkrDataLayer.push({
                        event: "pageView",
                        page: {
                            name: pageDataLayerObject.properties.sitePageName,
                            site_section: pageDataLayerObject.properties.siteSection,
                            site_subsection1: pageDataLayerObject.properties.siteSubsection1,
                            site_subsection2: pageDataLayerObject.properties.siteSubsection2,
                            site_subsection3: pageDataLayerObject.properties.siteSubsection3,
                            URL: window.location.href,
                            language: pageDataLayerObject.properties['xdm:language'],
                            type: pageDataLayerObject.properties.pageType,
                            siteName: pageDataLayerObject.properties.siteName,
                            country: pageDataLayerObject.properties.country
                        },
                        content: {
                            title : pageDataLayerObject.properties.pageName,
                            date  : pageDataLayerObject.properties.publicationDate,
                            category : pageDataLayerObject.properties.category,
                            topic : pageDataLayerObject.properties.topic
                        },
                        user: {
                            trafficType : pageDataLayerObject.properties.trafficType
                        }

                    });
        }

        function deferAPI() {
            const url = "\/content\/kkr\/sites\/global\/en\/errors\/404" +'/jcr:content.ipdetection.json';
            let xhr = new XMLHttpRequest();
            xhr.open("GET", url);
            xhr.send();
            xhr.onload = () => {
                const data = JSON.parse(xhr.responseText);
                if(data.trafficType) {
                    pageDataLayerObject.properties.trafficType = data.trafficType;
                    sessionStorage.setItem('trafficType',data.trafficType);
                    pushKkrDataLayerProperties();
                } else {
                    pageDataLayerObject.properties.trafficType = 'external';
                    sessionStorage.setItem('trafficType','external');
                    pushKkrDataLayerProperties();
                }
            };
        }
        pageDataLayerObject["properties"]["localTimestamp"] = getLocalTimestamp();
        if(!sessionStorage.getItem('trafficType')) {
            deferAPI();
        } else {
            pageDataLayerObject.properties.trafficType = sessionStorage.getItem("trafficType");
            pushKkrDataLayerProperties();
        }
        adobeDataLayer.push({
            page: pageDataLayerObject,
            event: 'cmp:show',
            eventInfo: {
                path: 'page.properties'
            }
        });
    })();
}

